import React from 'react';
import '../App.css';
import { Link } from 'react-router-dom';
import Header from './Header'
import './styles.scss';
import PageTitle from './PageTitle';
import Card from './Card';

const Components = () => (
  <>
  <Header />
  <PageTitle title="Components"></PageTitle>

  <div class="compWrapper">

    <Card path="/comp-docs/PageTitleDoc" cardName="Header"/>
    <Card path="/comp-docs/PageTitleDoc" cardName="Card"/>
  </div>
  </>
)

export default Components;
